/* NOTICE */

.notice {
  .notice-line {
    position: relative;

    .bg-left {
      position: absolute;
      top: 0;
      left: 0;
      width: 50%;
      height: 100%;
      background-color: #333;
    }

    .bg-right {
      position: absolute;
      top: 0;
      right: 0;
      width: 50%;
      height: 100%;
      background-color: #f6f5ef;
    }

    .inner {
      height: 62px;
      display: flex;
    }

    .inner__left {
      height: 100%;
      width: 60%;
      background-color: #333;
      display: flex;
      align-items: center;

      h2 {
        color: #fff;
        font-size: 17px;
        font-weight: 700;
        margin-right: 20px;
      }

      .swiper-container {
        height: 62px;
        flex-grow: 1;
        box-sizing: border-box;
      }

      .swiper-slide {
        height: 62px;
        display: flex;
        align-items: center;

        a {
          color: #fff;
        }
      }

      .notice-line__more {
        width: 62px;
        height: 62px;
        display: flex;
        justify-content: center;
        align-items: center;

        .material-icons {
          color: #fff;
          font-size: 30px;
        }
      }
    }

    .inner__right {
      height: 100%;
      width: 40%;
      display: flex;
      justify-content: flex-end;
      align-items: center;

      h2 {
        font-size: 17px;
        font-weight: 700;
      }

      .toggle-promotion {
        width: 62px;
        height: 62px;
        cursor: pointer;
        display: flex;
        justify-content: center;
        align-items: center;

        .material-icons {
          font-size: 30px;
        }
      }
    }
  }

  .promotion {
    height: 693px;
    background-color: #f6f5ef;
    position: relative;
    transition: height .4s;
    overflow: hidden;

    &.hide {
      height: 0;
    }

    .swiper-container {
      width: calc(819px * 3 + 20px);
      height: 553px;
      position: absolute;
      top: 40px;
      left: 50%;
      margin-left: calc((819px * 3 + 20px) / -2);
    }

    .swiper-slide {
      opacity: .5;
      transition: opacity 1s;
      position: relative;
    }

    .swiper-slide-active {
      opacity: 1;
    }

    .swiper-slide .btn {
      /*width: 130px;*/
      position: absolute;
      bottom: 0;
      left: 0;
      right: 0;
      margin: auto;
    }

    .swiper-pagination {
      bottom: 40px;
      left: 0;
      right: 0;
      z-index: 0;

      .swiper-pagination-bullet {
        background-color: transparent;
        background-image: url("../images/promotion_slide_pager.png");
        width: 13px;
        height: 12px;
        margin-right: 6px;
        outline: none;

        &:last-child {
          margin-right: 0;
        }
      }

      .swiper-pagination-bullet-active {
        background-image: url("../images/promotion_slide_pager_on.png");
      }
    }

    .swiper-prev, .swiper-next {
      width: 42px;
      height: 42px;
      outline: none;
      border: 2px solid #333;
      border-radius: 50%;
      position: absolute;

      /* Swiper Container 높이의 절반만큼 끌어올림 */
      /* 버튼 높이의 절반만큼 추가로 끌어올림 */
      top: 300px;
      z-index: 1;
      cursor: pointer;
      display: flex;
      justify-content: center;
      align-items: center;
      transition: .4s;
    }

    .swiper-prev {
      left: 50%;
      margin-left: -480px;
    }

    .swiper-next {
      right: 50%;
      margin-right: -480px;
    }

    .swiper-prev:hover, .swiper-next:hover {
      background-color: #333;
      color: #fff;
    }
  }
}

