/*<!--REVERSE STORE --> */

.reverse-store {
  background-image: url('../images/reserve_store_bg.jpg');
  background-repeat: no-repeat;
  background-position: center;
  background-size: cover;
  background-attachment: fixed;

  .inner {
    height: 600px;
    display: flex;
    justify-content: center;
    align-items: center;
  }

  .medal {
    width: 334px;
    height: 334px;
    perspective: 600px;

    .front, .back {
      width: 334px;
      height: 334px;
      backface-visibility: hidden;
      transition: 1s;
      position: absolute;
    }

    .front {
      transform: rotateY(0deg);
    }

    &:hover .front {
      transform: rotateY(180deg);
    }

    .back {
      transform: rotateY(-180deg);
    }

    &:hover .back {
      transform: rotateY(0deg);
    }

    .back .btn {
      position: absolute;
      top: 240px;
      left: 0;
      right: 0;
      margin: auto;
    }
  }
}

